            fas = function (kyta, kxta, kyac, kxac) {
                var dy = kyta - kyac;
                var dx = kxta - kxac;
                var fa = 0;

                if (dy == 0 && dx == 1) { fa = 1; }
                else if (dy == -1 && dx == 1) { fa = 7; }
                else if (dy == -1 && dx == 0) { fa = 2; }
                else if (dy == -1 && dx == -1) { fa = 6; }
                else if (dy == 0 && dx == -1) { fa = 5; }
                else if (dy == 1 && dx == -1) { fa = 8; }
                else if (dy == 1 && dx == 0) { fa = 4; }
                else if (dy == 1 && dx == 1) { fa = 9; }

                return fa;
            },
